import React, { useEffect, useState } from 'react';
import {
  Container,
  Typography,
  Box,
  Paper,
  Grid,
  Chip,
  Button,
  Stepper,
  Step,
  StepLabel,
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import ReceiptIcon from '@mui/icons-material/Receipt';
import LocalShippingIcon from '@mui/icons-material/LocalShipping';
import PaymentIcon from '@mui/icons-material/Payment';
import { useSelector } from 'react-redux';

const Orders = () => {
  const navigate = useNavigate();
  const [soldCars, setSoldCars] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetch('http://localhost:5000/api/cars/sold')
      .then(res => res.json())
      .then(data => {
        setSoldCars(data);
        setLoading(false);
      })
      .catch(err => {
        console.error('Error fetching sold cars:', err);
        setLoading(false);
      });
  }, []);

  const getStatusColor = (status) => {
    switch (status) {
      case 'Processing':
        return 'warning';
      case 'Confirmed':
        return 'info';
      case 'Delivered':
        return 'success';
      case 'sold':
        return 'success';
      default:
        return 'default';
    }
  };

  const orderSteps = ['Order Placed', 'Processing', 'Delivered'];

  return (
    <Container maxWidth="lg" sx={{ py: 4 }}>
      <Typography variant="h4" gutterBottom>
        Sold Cars
      </Typography>

      <Grid container spacing={3}>
        {loading ? (
          <Grid item xs={12}><Typography variant="body1">Loading...</Typography></Grid>
        ) : soldCars.length > 0 ? (
          soldCars.map((car) => (
            <Grid item xs={12} key={car._id}>
              <Paper
                elevation={2}
                sx={{
                  p: 3,
                  borderRadius: 2,
                  '&:hover': { transform: 'translateY(-2px)', transition: 'transform 0.2s' },
                }}
              >
                <Grid container spacing={3}>
                  <Grid item xs={12} sm={3}>
                    <img
                      src={car.images && car.images[0] ? `http://localhost:5000${car.images[0]}` : ''}
                      alt={car.title}
                      style={{
                        width: '100%',
                        height: '120px',
                        objectFit: 'cover',
                        borderRadius: '8px',
                      }}
                    />
                  </Grid>

                  <Grid item xs={12} sm={6}>
                    <Typography variant="h6" gutterBottom>
                      {car.title}
                    </Typography>

                    <Typography variant="body2" color="text.secondary">
                      {car.brand} {car.model} | {car.year}
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      Registration: {car.registrationNumber}
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      Owner Count: {car.ownerCount}
                    </Typography>
                  </Grid>

                  <Grid item xs={12} sm={3} sx={{ textAlign: 'right' }}>
                    <Typography variant="h6" color="primary.main" gutterBottom>
                      {car.price}
                    </Typography>

                    <Chip
                      label={car.status}
                      color={car.status === 'sold' ? 'success' : 'default'}
                      sx={{ mb: 2 }}
                    />

                    <Box>
                      <Button
                        variant="outlined"
                        size="small"
                        onClick={() => navigate(`/car/${car._id}`)}
                        sx={{ mr: 1 }}
                      >
                        View Car
                      </Button>
                    </Box>
                  </Grid>
                </Grid>
              </Paper>
            </Grid>
          ))
        ) : (
          <Grid item xs={12}>
            <Box sx={{ textAlign: 'center', py: 8 }}>
              <Typography variant="h6" color="text.secondary" gutterBottom>
                No sold cars found
              </Typography>
              <Button
                variant="contained"
                onClick={() => navigate('/')}
                sx={{ mt: 2 }}
              >
                Browse Cars
              </Button>
            </Box>
          </Grid>
        )}
      </Grid>
    </Container>
  );
};

export default Orders;
